                         b.PrefContactNo, b.EmailAddress, a.FleetID, a.NLID, a.VIN AS Expr1, a.PlateNo, a.RegistrationDate, a.RegistrationNo, a.EngineNo, a.EngineCode, a.EngineType, 
                         a.Year, a.Make AS Expr2, a.Model AS Expr3, a.Series AS Expr4, a.Color, a.VehCat, a.VehType, a.NonVehType, a.ReqStatus, a.UtilStatus AS Expr5, a.Status, 
                         a.LastService, a.ReleasedDate, a.Released, a.Mileage, a.MeterType, a.FuelType, a.Transmission, a.Doors, a.TyreSize, a.NonVehTypeID, a.UdfLbl1, a.UdfLbl2, 
