DROP PROCEDURE [dbo].[AverageCostOfMaintenance]
GO





CREATE PROCEDURE [dbo].[AverageCostOfMaintenance]
    @sCode varchar(15), 
    @sDate date,
    @eDate date
AS 
	DECLARE @_qry nvarchar(max)
	, @_condition nvarchar(150)
	, @_code varchar(10)
	, @_startDate date
	, @_endDate date;
	
	SET @_startDate = @sDate;
    SET @_endDate = @eDate;
	SET @_code = @sCode;
	SET @_condition = (SELECT CASE WHEN @_code = 'All' THEN '' ELSE ' AND RIGHT(flt.SiteCode, 3) = @siteCode ' END);
	SET @_qry = 'SELECT 
	CASE WHEN @siteCode = ''All'' THEN ''All Sites'' ELSE  RIGHT(flt.SiteCode, 3) END AS [LOCATION]
	, flt.VIN 
	, flt.Make AS [MAKE]
	, flt.Model AS [MODEL]
	, flt.[Year] AS [YEAR]
	, COUNT(wo.WONo) AS [NUMBER OF TIMES IN FACILITY]
	, SUM(wo.WOGross) AS [TOTAL WO VALUE]
	, SUM(wo.WOGross)/COUNT(wo.WONo) AS [AVERAGE PER WO]
	FROM fleet AS flt INNER JOIN workorder AS wo ON wo.NLID = flt.NLID ' 
	+ @_condition + 
	' AND wo.Issued BETWEEN @startDate AND @endDate
	AND wo.Status = ''Closed''
	GROUP BY flt.VIN, flt.Make, flt.Model, flt.[Year], flt.SiteCode
	order by flt.SiteCode ASC;';

	EXEC sp_executesql
		@statement = @_qry,
		@parameters = N'@siteCode nvarchar(10), @startDate date, @endDate date',
		@siteCode = @_code,
		@startDate = @_startDate,
		@endDate = @_endDate;









GO

