-- Procedure structure for EquipmentByOwnership
-- ----------------------------
DROP PROCEDURE [dbo].[EquipmentByOwnership]
GO





CREATE PROCEDURE [dbo].[EquipmentByOwnership] 
    @SDate date, 
    @EDate date
AS 
	declare @StartDate2 date;
	declare @EndDate2 date;
	set @StartDate2 = @SDate;
	set @EndDate2 = @EDate;
	
	select tbl.series, tbl.category, sum(tbl.cnt) as 'count' from 
	(
	select 
	'Inspection' as [series]
	, fleet.OwnershipType as [category]
	, COUNT(fleet.SiteCode) as [cnt]
	from fleet
	inner join vehicle_inspection as ins on ins.NLID = fleet.NLID
	and ins.DateReported between @StartDate2 and @EndDate2
	group by fleet.OwnershipType

	UNION ALL 

	select 
	'Written-Off' as 'series'
	, fleet.OwnershipType as 'category'
	, COUNT(fleet.SiteCode) as 'count' 
	from fleet 
	inner join wor_vehicle_info as info on info.VIN = fleet.VIN
	and info.ReportDate between @StartDate2 and @EndDate2
	group by fleet.OwnershipType

	UNION ALL

	select 
	'Maintenance' as 'series'
	, fleet.OwnershipType as 'category'
	, COUNT(fleet.SiteCode) as 'count' 
	from fleet
	inner join workorder as wo on wo.NLID = fleet.NLID
	and wo.Issued between @StartDate2 and @EndDate2
	group by fleet.OwnershipType
	) as tbl group by tbl.series, tbl.category order by tbl.series;









