CREATE PROCEDURE [dbo].[InvoiceSummary]
    @sCode varchar(15), 
    @sDate date,
    @eDate date
AS 
	DECLARE @_qry nvarchar(max)
	, @_condition nvarchar(150)
	, @_code varchar(10)
	, @_startDate date
	, @_endDate date;
	
	SET @_startDate = @sDate;
    SET @_endDate = @eDate;
	SET @_code = @sCode;
	SET @_condition = (SELECT CASE WHEN @_code = 'All' THEN '' ELSE ' AND wo.SiteCode = @siteCode ' END);
	SET @_qry = 'SELECT
	wo.QuotationNo AS [QUOTATION NO.]
	, wo.WONo AS [WO NO.]
	, wo.Closed AS [CLOSED]
	, woi.InvoiceNo AS [INVOICE NO.]
	, flt.VIN
	, flt.Make + '' '' + flt.Model AS [VEHICLE]
	, SUM(wo.WOGross) AS [TOTAL]
	, CASE WHEN @siteCode = ''All'' THEN '''' ELSE wo.SiteCode END AS [SiteCode]
	FROM fleet AS flt
	INNER JOIN workorder AS wo ON wo.NLID = flt.NLID
	INNER JOIN workorderinvoices AS woi ON woi.WONo = wo.WONo
	WHERE wo.Status = ''closed'''
	+ @_condition + 
	' AND woi.DateOpen BETWEEN @startDate AND @endDate
	GROUP BY woi.InvoiceNo, wo.WONo, wo.QuotationNo, wo.Closed, flt.VIN, flt.Make, flt.Model, wo.SiteCode;';

	EXEC sp_executesql
		@statement = @_qry,
		@parameters = N'@siteCode nvarchar(10), @startDate date, @endDate date',
		@siteCode = @_code,
		@startDate = @_startDate,
		@endDate = @_endDate;









