-- ----------------------------
-- Procedure structure for Quarterly_Util
-- ----------------------------
DROP PROCEDURE [dbo].[Quarterly_Util]
GO






CREATE PROCEDURE [dbo].[Quarterly_Util]
	@Quarter VARCHAR(100) = null,
	@Yr VARCHAR(100) = null
AS
BEGIN
		;with records (year_number, quarter_number, record_number) as
		(
				select year_number,
						row_number() over (partition by year_number order by year_number) quarter_number,
						row_number() over (order by year_number) record_number
				from 
						(
								select
										ntile(10) over (order by [object_id]) + 2010 year_number
										from (select top 40 object_id from sys.objects) t 
						) t
			where year_number <= DATEPART(YEAR, GETDATE())
		)

		,StartEndDates AS(
			 select
						year_number, quarter_number, 
				dateadd(qq, record_number - 1, '20110101') begin_date, 
				dateadd(qq, record_number, '20110101') - '19000101 00:00:000.003' end_date
				from records
		)

		,dates AS(
			SELECT CAST(begin_date AS DATE) as DateValue FROM StartEndDates WHERE quarter_number = @Quarter AND year_number = @Yr
			UNION ALL 
			SELECT DATEADD(d, 1, DateValue)
			FROM dates	
			WHERE DateValue < (SELECT CAST(end_date AS DATE) as d FROM StartEndDates WHERE quarter_number = @Quarter AND year_number = @Yr)
		)

		SELECT t0.DateValue [Days]
				, CASE WHEN t0.DateValue <= GETDATE() THEN COUNT(VIN) ELSE 0 END PeakDemand
				,(SELECT COUNT(VIN) FROM fleet WHERE RegistrationDate <= t0.DateValue AND SUBSTRING(SiteCode, 1, 1) = 'F' AND RegistrationDate IS NOT NULL AND Status <> 'Written-Off' AND (IsArchive = 0 OR IsArchive IS NULL) AND Active =1) Capacity
				, CASE WHEN t0.DateValue <= GETDATE() THEN COUNT(VIN) / (SELECT COUNT(DISTINCT SiteCode) FROM fleet) END AveDemand
		FROM(
		SELECT DISTINCT wl.VIN, c.DateValue, CASE WHEN CAST(c.DateValue AS Date) > GETDATE() THEN 0 ELSE 1 END AveCnt,DATEPART(MONTH, c.DateValue) months
		FROM dates c CROSS JOIN wp_lease_vehicle wl
		WHERE ((wl.Status = 'Closed' AND c.DateValue BETWEEN wl.StartDate AND wl.EndDate) OR (wl.Status = 'Open' AND wl.StartDate <= c.DateValue))
		)t0
		GROUP BY t0.DateValue,t0.months
		OPTION (MAXRECURSION 0)
END








