CREATE PROCEDURE [dbo].[usp_Authorized_Equipment]
	@SiteCode VARCHAR(100) = null
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

	select a.NLID,a.VehicleTag,a.VIN,a.Make,
	a.Model,a.Year,a.Color,a.VehType,
	case when a.Armored = 1 THEN 'Armoured' ELSE 'Soft-Skin' END BodyType,a.VehCat,a.TPEno,
	avr.*,a.ActLocation SiteCode,a.FuelSticker,a.Status,a.RegionalCommand,a.PlateNo,
	a.RegistrationDate,a.RegionalCommand,a.EngineNo,a.EngineType,a.Series,a.Mileage,
	a.MeterType,a.FuelType,a.Transmission,a.Doors,a.TyreSize,a.Province,
	a.PassCap,a.Barcode,a.EngineSize,a.FuelCapacity,a.KeyTag,a.TransmissionCode
		from fleet a 
	OUTER APPLY
	(select top 1 vr.MajorCommand,a.OwnershipType OwnershipType,
	CASE WHEN vr.VehClassification LIKE '%GSA%' THEN 'Yes' ELSE 'No' END GSAGP,
	vr.FuelSerialNo,vr.UnitNTVFMrank,vr.UnitOrgSec,
	vr.UnitNTVFMname,vr.UnitNTVFMContactNo,vr.UnitNTVFMemail,
	vr.LeaseCompany,vr.LeaseExpireDate,vr.sRegDate,vr.sRegExpireDate,vr.vmarbApproveDate
	from vehicle_registration vr
	where vr.VIN = a.vIN) as avr
	where (a.Status <> 'Written-Off') and (a.IsArchive IS NULL OR a.IsArchive = 0) and a.Active = 1
	UNION
	select NULL NLID,a.VehicleTag,a.VIN,a.Make,
	a.Model,a.Year,a.Color,a.VehType,
	case when a.Armored = 1 THEN 'Armoured' ELSE 'Soft-Skin' END BodyType,a.VehCat,a.TPEno,
	avr.*,a.ActLocation SiteCode,a.FuelSticker,a.Status,a.RegionalCommand,a.PlateNo,
	a.RegistrationDate,a.RegionalCommand,a.EngineNo,a.EngineType,a.Series,a.Mileage,
	a.MeterType,a.FuelType,a.Transmission,a.Doors,a.TyreSize,a.Province,
	a.PassCap,a.Barcode,a.EngineSize,a.FuelCapacity,a.KeyTag,a.TransmissionCode
		from fleet_authorized a 
	OUTER APPLY
	(select top 1 vr.MajorCommand,vr.VehClassification OwnershipType,
	CASE WHEN vr.VehClassification LIKE '%GSA%' THEN 'Yes' ELSE 'No' END GSAGP,
	vr.FuelSerialNo,vr.UnitNTVFMrank,vr.UnitOrgSec,
	vr.UnitNTVFMname,vr.UnitNTVFMContactNo,vr.UnitNTVFMemail,
	vr.LeaseCompany,vr.LeaseExpireDate,vr.sRegDate,vr.sRegExpireDate,vr.vmarbApproveDate
	from vehicle_registration vr
	where vr.VIN = a.vIN) as avr
	where (a.TransferType is null or a.TransferType <> 'LDO-TRANSFERED') and a.Status IN ('Active','Approved') 
END








