-- ----------------------------
-- Procedure structure for usp_Get_Annual_Util
-- ----------------------------
DROP PROCEDURE [dbo].[usp_Get_Annual_Util]
GO




CREATE PROCEDURE [dbo].[usp_Get_Annual_Util]
	@Qtr1 AS int,
	@Qtr2 AS int,
	@Year1 AS VARCHAR(4),
	@Year2 AS VARCHAR(4),
	@Div as VARCHAR(4)
AS
BEGIN
	DECLARE @sqlCommand NVARCHAR(1000) 
	DECLARE @SQTR1 VARCHAR(20)
	DECLARE @SQTR2 VARCHAR(20)

	SET @SQTR1 = CASE @Qtr1 WHEN 3 THEN '1stQMin' WHEN 6 THEN '2ndQMin' WHEN 9 THEN '3rdQMin' ELSE '4thQMin' END;
	SET @SQTR2 = CASE @Qtr2 WHEN 3 THEN '1stQ' WHEN 6 THEN '2ndQ' WHEN 9 THEN '3rdQ' ELSE '4thQ' END;
	 
	SET @sqlCommand = 'select f.NLID,  v.VIN,v.VehType,f.MeterType,
					f.[Year],f.Make,f.Model,
					v.MinQ,v.MaxQ,CONVERT(bigint,(v.MaxQ - v.MinQ) / ' + @Div + ') as AVM,
					CONVERT(bigint,SUM((MaxQ - MinQ) / ' + @Div + ') OVER(PARTITION BY v.VehType) / COUNT(v.VIN) OVER(PARTITION BY v.VehType)) AAU,
					CONVERT(bigint,SUM((MaxQ - MinQ) / ' + @Div + ') OVER(PARTITION BY v.VehType) / COUNT(v.VIN) OVER(PARTITION BY v.VehType)* 0.5) UTP
					FROM
					(select a.VIN,a.VehType,MAX(MinQ) MinQ,MAX(MaxQ) MaxQ  FROM 
					(select v.VIN,v.VehType,
					v.[' + @SQTR1 + '] MinQ,0 MaxQ
					from vin_metrics v 
					where	v.[Year] = ' + @Year1 + '  
					UNION ALL
					select v.VIN,v.VehType,
					0 MinQ,v.[' + @SQTR2 + '] MaxQ
					from vin_metrics v 
					where	v.[Year] = ' + @Year2 + '  ) a
					GROUP BY a.VIN,a.VehType) v
					inner join fleet f 
					on v.vin = f.vin 
					where	f.MeterType in (''Mile'',''Kilometers'')
							and v.MaxQ - v.MinQ > 0
					order by VIN';

	EXEC(@sqlCommand)
END








