-- Procedure structure for usp_Get_MelDetails
-- ----------------------------
DROP PROCEDURE [dbo].[usp_Get_MelDetails]
GO




CREATE PROCEDURE [dbo].[usp_Get_MelDetails]
	@CURDATE AS DATE,
	@Type AS INT
AS
BEGIN
IF @Type = 0
	BEGIN
		select ws.Class,ws.[Type],SUM(ws.Total) Total,
		SUM(ws.Total) - (SUM(ws.NMCM) + SUM(ws.NMCS)) MC,
		SUM(ws.NMCM) NMCM,SUM(ws.NMCS) NMCS
		from wp_mel_main m 
		inner join wp_mel_operationalreadiness ws
		ON m.MainID = ws.MainID
		WHERE m.[Date] = @CURDATE
		GROUP BY ws.Class,ws.[Type]
	END
ELSE IF @Type = 1
	BEGIN
		select ws.Location,SUM(ws.VRNew) TIVNew,
		SUM(ws.VRActive) TIActive,
		SUM(ws.VRDeregistered) TIINActive,
		SUM(ws.VRDRMO) TIWOff
		from wp_mel_main m 
		inner join wp_mel_registrationcount ws
		ON m.MainID = ws.MainID
		WHERE m.[Date] = @CURDATE
		GROUP BY ws.Location
	END
ELSE IF @Type = 2
	BEGIN
		select ws.Location,SUM(ws.TIVNew) TIVNew,
		SUM(ws.TIActive) TIActive,
		SUM(ws.TIINActive) TIINActive,
		SUM(ws.TIWOff) TIWOff
		from wp_mel_main m 
		inner join wp_mel_vehiclecount ws
		ON m.MainID = ws.MainID
		WHERE m.[Date] = @CURDATE
		GROUP BY ws.Location
	END
ELSE IF @Type = 3
	BEGIN
		select ws.SiteCode,ws.[Open],ws.TempClose,ws.Closed,ws.ForRelease,ws.Released,ws.Outstanding,ws.NMC,ws.WrittenOff
		from wp_mel_main m 
		inner join wp_mel_wosummary ws
		ON m.MainID = ws.MainID
		WHERE m.[Date] = @CURDATE
	END
ELSE IF @Type = 4
	BEGIN
		select wp.WONo,f.VehCat,f.VehType,f.Make,f.Model,f.VIN,f.OwnershipType,
		f.ActLocation,wo.Location,wp.VehStatus,wo.Issued,
		DATEDIFF(DAY, wo.Issued ,@CURDATE) DOpen,wp.ETIC,wp.Reason
		from wp_mel_main m 
		inner join wp_mel_wodetails wp ON m.MainID = wp.MainID 
		inner join workorder wo on
		wp.wono = wo.wono inner join fleet f on wp.nlid = f.NLID
		WHERE m.[Date] = @CURDATE
	END
END








