CREATE PROCEDURE [dbo].[usp_GetHome_Counter] 

AS
BEGIN
	SET NOCOUNT ON;
	 
	select COUNT(VIN) Ctr, 'Fleet' Cols from fleet where Status <> 'Written-Off' and (IsArchive = 0  or IsArchive is null) and LEFT(SiteCode,1) = 'F' and Active = 1 UNION 
	select COUNT(VIN),'Authorized' from fleet_authorized where (TransferType NOT LIKE '%TRANSFERED%' or TransferType IS NULL) and [Status] in ('Active','Approved') UNION
	select COUNT(VIN),'ForInspection' from fleet where [Status] = 'For Inspection' and (IsArchive = 0  or IsArchive is null) and LEFT(SiteCode,1) = 'F' and Active = 1  UNION
	select COUNT(NLID),'Available' from fleet where ReqStatus = 'Available' and Status in ('Completed Repair','Released Awaiting for Parts') and (IsArchive = 0  or IsArchive is null) and LEFT(SiteCode,1) = 'F' and Active = 1  UNION
	select COUNT(VIN),'Reserved' from fleet where ReqStatus = 'Reserved' and Status in ('Completed Repair','Released Awaiting for Parts') and (IsArchive = 0  or IsArchive is null) and (UtilStatus = 'Confirmed' or UtilStatus = 'Reserved') and LEFT(SiteCode,1) = 'F' and Active = 1 UNION
	select COUNT(VIN),'OnLease' from fleet where [Status] in ('Completed Repair','Released Awaiting for Parts') and (IsArchive = 0  or IsArchive is null) and (UtilStatus = 'On-going' or UtilStatus = 'On Lease') and LEFT(SiteCode,1) = 'F' and Active = 1 UNION
	select COUNT(VIN),'OnLeaseForRelease' from fleet where [Status] IN ('For Release') and (IsArchive = 0  or IsArchive is null) and (UtilStatus = 'On-going' or UtilStatus = 'On Lease') and Active = 1 UNION
	select COUNT(f.NLID),'OnLeaseMC'
	from fleet f
	inner join 
	(select NLID,MAX(CASE VehStatus WHEN 'MC' THEN 0 WHEN 'NMCM' THEN 1 ELSE 2 END) MC  from workorder 
	where status = 'Open'
	GROUP BY NLID) a on f.nlid = a.nlid
	where f.Status = 'In-Progress' and (f.IsArchive = 0  or f.IsArchive is null)  and f.UtilStatus = 'On Lease' and a.MC = 0 UNION
	select COUNT(f.NLID),'OnLeaseNMCM'
	from fleet f
	inner join 
	(select NLID,MAX(CASE VehStatus WHEN 'MC' THEN 0 WHEN 'NMCM' THEN 1 ELSE 2 END) MC  from workorder 
	where status = 'Open'
	GROUP BY NLID) a on f.nlid = a.nlid
	where f.Status = 'In-Progress' and (f.IsArchive = 0  or f.IsArchive is null)  and f.UtilStatus = 'On Lease' and a.MC = 1 UNION
	select COUNT(f.NLID),'OnLeaseNMCS'
	from fleet f
	inner join 
	(select NLID,MAX(CASE VehStatus WHEN 'MC' THEN 0 WHEN 'NMCM' THEN 1 ELSE 2 END) MC  from workorder 
	where status = 'Open'
	GROUP BY NLID) a on f.nlid = a.nlid
	where f.Status = 'In-Progress' and (f.IsArchive = 0  or f.IsArchive is null)  and f.UtilStatus = 'On Lease' and a.MC = 2 UNION
	select COUNT(VIN),'OffLeaseForRelease'
	from fleet where [Status] IN ('For Release') and (IsArchive = 0  or IsArchive is null) and UtilStatus not in ('On-going','On Lease') and Active = 1 UNION
	select COUNT(f.VIN),'OffLeaseMC'
	from fleet f
	inner join 
	(select NLID,MAX(CASE VehStatus WHEN 'MC' THEN 0 WHEN 'NMCM' THEN 1 ELSE 2 END) MC  from workorder 
	where status = 'Open'
	GROUP BY NLID) a on f.nlid = a.nlid
	where f.Status = 'In-Progress' and (f.IsArchive = 0  or f.IsArchive is null)  and f.UtilStatus not in ('On-going','On Lease') and a.MC = 0 UNION
	select COUNT(f.VIN),'OffLeaseNMCS'
	from fleet f
	inner join 
	(select NLID,MAX(CASE VehStatus WHEN 'MC' THEN 0 WHEN 'NMCM' THEN 1 ELSE 2 END) MC  from workorder 
	where status = 'Open'
	GROUP BY NLID) a on f.nlid = a.nlid
	where f.Status = 'In-Progress' and (f.IsArchive = 0  or f.IsArchive is null) and f.UtilStatus not in ('On-going','On Lease') and a.MC = 2 UNION
	select COUNT(f.VIN),'OffLeaseNMCM'
	from fleet f
	inner join 
	(select NLID,MAX(CASE VehStatus WHEN 'MC' THEN 0 WHEN 'NMCM' THEN 1 ELSE 2 END) MC  from workorder 
	where status = 'Open'
	GROUP BY NLID) a on f.nlid = a.nlid
	where f.Status = 'In-Progress' and (f.IsArchive = 0  or f.IsArchive is null)  and f.UtilStatus not in ('On-going','On Lease') and  a.MC = 1 UNION
	select COUNT(VIN),'ForInspectionNMCM' from fleet where [Status] = 'For Inspection' and (IsArchive = 0  or IsArchive is null) and LEFT(SiteCode,1) = 'F' AND DATEDIFF(DAY,RegistrationDate,GETDATE()) >= 3 and Active = 1 UNION
	select Count(QuotationNo),'QuoteApproval' from quotation where Status = 'For Approval' and ForApproval = 1 UNION
	select COUNT(VIN), 'DueInspect' from fleet where Status in ('Completed Repair','Released Awaiting for Parts') and NextServiceDate <= GETDATE() and (IsArchive = 0  or IsArchive is null) and (ExcludeInspect = 0  or ExcludeInspect is null) and LEFT(SiteCode,1) = 'F' and Active = 1  UNION 
	select COUNT(f.NLID), 'DueReturn' from fleet f inner join req_utilize_form r on f.NLID = r.VehID where f.Status not in ('Written-Off') and r.UtilStatus in ('On-going','On Lease') and (IsArchive = 0  or IsArchive is null) and DATEDIFF(DAY,r.ReturnDate,GETDATE()) > 0 and LEFT(SiteCode,1) = 'F' and Active = 1 UNION
	select count(wono),'OpenWOMC' From workorder where [status] = 'Open' and (VehStatus = 'MC' OR VehStatus = '') UNION
	select count(wono),'OpenWONMCM' From workorder where [status] = 'Open' and VehStatus = 'NMCS' UNION
	select count(wono),'OpenWONMCS' From workorder where [status] = 'Open' and VehStatus = 'NMCM' UNION
	select count(wono),'TempCloseWO' From workorder where [status] = 'Closed' and TempClose = 1 UNION
	select count(wono),'ProjCloseWO' From workorder where [status] = 'Closed' and (TempClose = 0 OR TempClose IS NULL)
END








