	from fleet f
	inner join 
	(select NLID,MAX(CASE VehStatus WHEN 'MC' THEN 0 WHEN 'NMCM' THEN 1 ELSE 2 END) MC  from workorder 
	where status = 'Open'
	GROUP BY NLID) a on f.nlid = a.nlid
	where f.Status = 'In-Progress' and (f.IsArchive = 0  or f.IsArchive is null)  and f.UtilStatus <> 'On Lease' and a.MC = 0 UNION
	select COUNT(f.VIN),'NMCS'
	from fleet f
	inner join 
	(select NLID,MAX(CASE VehStatus WHEN 'MC' THEN 0 WHEN 'NMCM' THEN 1 ELSE 2 END) MC  from workorder 
	where status = 'Open'
	GROUP BY NLID) a on f.nlid = a.nlid
	where f.Status = 'In-Progress' and (f.IsArchive = 0  or f.IsArchive is null)  and a.MC = 2 UNION
	select COUNT(f.VIN),'NMCM'
	from fleet f
	inner join 
	(select NLID,MAX(CASE VehStatus WHEN 'MC' THEN 0 WHEN 'NMCM' THEN 1 ELSE 2 END) MC  from workorder 
	where status = 'Open'
	GROUP BY NLID) a on f.nlid = a.nlid
	where f.Status = 'In-Progress' and (f.IsArchive = 0  or f.IsArchive is null)  and  a.MC = 1 UNION
	select COUNT(VIN), 'TotalServed' from fleet where Status not in ('Written-Off','For Inspection') and (IsArchive = 0  or IsArchive is null) and LEFT(SiteCode,1) = 'F'  UNION
	select Count(QuotationNo),'QuoteApproval' from quotation where Status = 'For Approval' and ForApproval = 1 UNION
	select COUNT(VIN), 'DueInspect' from fleet where Status in ('Completed Repair') and NextServiceDate <= GETDATE() and (IsArchive = 0  or IsArchive is null) and (ExcludeInspect = 0  or ExcludeInspect is null) and LEFT(SiteCode,1) = 'F'  UNION 
	select COUNT(f.NLID), 'DueReturn' from fleet f inner join req_utilize_form r on f.NLID = r.VehID where f.Status not in ('Written-Off') and r.UtilStatus in ('On-going','On Lease') and (IsArchive = 0  or IsArchive is null) and DATEDIFF(DAY,r.ReturnDate,GETDATE()) > 0 and LEFT(SiteCode,1) = 'F' 
END








