-- ----------------------------
DROP PROCEDURE [dbo].[usp_Set_UtilEndDate]
GO




CREATE PROCEDURE [dbo].[usp_Set_UtilEndDate]
	@SREQRefNo AS VARCHAR(20)
AS
BEGIN
	DECLARE @NLID VARCHAR(50)
	DECLARE @VIN VARCHAR(150)
	DECLARE @ReqRefNo VARCHAR(20)
	DECLARE @LeaseType VARCHAR(20)
	DECLARE @UtilDate DATE
	DECLARE @ReturnDate DATE
	DECLARE @DateReturned DATE
	DECLARE @curMinDate DATE
	DECLARE @curEndDate DATE
	DECLARE @curRefNo VARCHAR(20)
	DECLARE @curLeaseType VARCHAR(20)
	DECLARE @curVIN VARCHAR(150)
	DECLARE @curNLID VARCHAR(50)
	DECLARE @status VARCHAR(50)
	DECLARE @curstatus VARCHAR(50)

	DECLARE cur CURSOR FOR  SELECT		VehID,VIN,ReqRefNo,LeaseType,UtilDate,ReturnDate,DateReturned,UtilStatus 
							FROM		req_utilize_form 
							WHERE		ReqRefNo = @SREQRefNo
							ORDER BY	ReqRefNo,TransactNo
	SET @curRefNo = ''
	OPEN cur
	FETCH NEXT FROM cur INTO @NLID,@VIN,@ReqRefNo,@LeaseType,@UtilDate,@ReturnDate,@DateReturned,@status
	WHILE @@FETCH_STATUS = 0
		BEGIN
			IF (@curRefNo = '')
				BEGIN
					SET @curRefNo = @ReqRefNo
					SET @curMinDate = @UtilDate
					SET @curEndDate = @ReturnDate
					SET @curLeaseType = @LeaseType
					SET @curVIN = @VIN
					SET @curNLID = @NLID
					SET @curstatus = 'Closed'
				END

			IF (@curRefNo <> @ReqRefNo)
				BEGIN
					DELETE FROM wp_lease_vehicle WHERE ReqRefNo = @curRefNo
					INSERT INTO wp_lease_vehicle SELECT @curNLID,@curVIN,@curRefNo,@curMinDate,@curEndDate,@curLeaseType,@curstatus

					SET @curRefNo = @ReqRefNo
					SET @curMinDate = @UtilDate
					SET @curEndDate = @ReturnDate
					SET @curLeaseType = @LeaseType
					SET @curVIN = @VIN
					SET @curNLID = @NLID
					SET @curstatus = 'Closed'
				END

			IF @status = 'Reserved'
				BEGIN
					SET @curstatus = 'Reserved'
				END
			ELSE IF @status <> 'Completed' and @status <> 'Off Lease'
				BEGIN
					SET @curstatus = 'Open'
				END


			IF @curMinDate > @UtilDate
				BEGIN
					SET @curMinDate = @UtilDate
				END

			IF @curEndDate > @ReturnDate
				BEGIN
					SET @curEndDate = @ReturnDate
				END

			IF @DateReturned is not null
				BEGIN
					SET @curEndDate = @DateReturned
				END

			FETCH NEXT FROM cur INTO @NLID,@VIN,@ReqRefNo,@LeaseType,@UtilDate,@ReturnDate,@DateReturned,@status
		END

	CLOSE cur;
	DEALLOCATE cur;

	DELETE FROM wp_lease_vehicle WHERE ReqRefNo = @curRefNo
	INSERT INTO wp_lease_vehicle SELECT @curNLID,@curVIN,@curRefNo,@curMinDate,@curEndDate,@curLeaseType,@curstatus
END








