CREATE PROCEDURE [dbo].[usp_Update_ID]
	@OLDNLID AS VARCHAR(20),
	@NEWNLID AS VARCHAR(20) 
AS
BEGIN
	DECLARE @CurLastService datetime
	DECLARE @CurRelDate datetime
	DECLARE @Released int

	SELECT	@CurLastService = LastService,@CurRelDate = ReleasedDate,
			@Released = Released
	FROM	Fleet WHERE NLID = @OLDNLID;

	IF (@CurLastService is not null)
	BEGIN
		UPDATE fleet SET 
		LastService = CASE WHEN  LastService IS NULL THEN @CurLastService ELSE LastService END,
		ReleasedDate = CASE WHEN  ReleasedDate IS NULL THEN @CurRelDate ELSE ReleasedDate END,
		Released = @Released
		WHERE NLID = @NEWNLID;
	END

	UPDATE fleet_armor SET NLID = @NEWNLID WHERE nlid = @OLDNLID;
	UPDATE fleet_enghistory SET NLID = @NEWNLID WHERE nlid = @OLDNLID;
	UPDATE fleet_fuelmonitoring SET NLID = @NEWNLID WHERE nlid = @OLDNLID;
	UPDATE fleet_odomhistory SET NLID = @NEWNLID WHERE nlid =@OLDNLID;
	UPDATE req_utilize_form SET VehID = @NEWNLID WHERE VehID = @OLDNLID;
	UPDATE quotation SET NLID = @NEWNLID WHERE nlid = @OLDNLID;
	UPDATE vehicle_inspection SET NLID = @NEWNLID WHERE nlid = @OLDNLID;
	UPDATE workorder SET NLID = @NEWNLID WHERE nlid = @OLDNLID;
	UPDATE uploadedimage SET ReferenceCode = @NEWNLID WHERE ReferenceCode = @OLDNLID;
	UPDATE fleet_details SET NLID = @NEWNLID WHERE nlid = @OLDNLID;
	UPDATE wp_lease_vehicle SET NLID = @NEWNLID where nlid = @OLDNLID;
	UPDATE workrequest SET NLID = @NEWNLID where nlid = @OLDNLID;
	
	INSERT INTO deregistered_vins(Site,VIN,DeReg_date,[Status],FromF) SELECT ActLocation,VIN,CONVERT(date, GETDATE()),'Deregistered',1 FROM	Fleet WHERE NLID = @OLDNLID;

	DELETE FROM fleet where NLID IN (@OLDNLID);
END








