-- ----------------------------
-- Procedure structure for usp_Update_VIN_Metrics
-- ----------------------------
DROP PROCEDURE [dbo].[usp_Update_VIN_Metrics]
GO




CREATE PROCEDURE [dbo].[usp_Update_VIN_Metrics]
	@VIN AS VARCHAR(30)
AS
BEGIN
SET NOCOUNT ON;

DECLARE @sVIN VARCHAR(30)
DECLARE @sVehType VARCHAR(100)
DECLARE @iMeter BIGINT
DECLARE @iYear INT
DECLARE @iMonth INT
DECLARE @iExist VARCHAR(50)

DECLARE cur CURSOR FOR	SELECT fleet.VIN,fleet.VehType,workorder.Meter,DATEPART(year,workorder.Issued) [Year],Month(workorder.Issued) [Month] 
						FROM fleet INNER JOIN workorder ON fleet.NLID = workorder.NLID
						WHERE VIN = @VIN
OPEN cur
FETCH NEXT FROM cur INTO @sVIN,@sVehType,@iMeter,@iYear,@iMonth
WHILE @@FETCH_STATUS = 0
BEGIN
		SET @iExist = 0
		SELECT @iExist = 1 FROM vin_metrics WHERE VIN = @sVIN AND [Year] = @iYear
		IF (@iExist > 0) 
			BEGIN
				IF @iMonth <= 3
					BEGIN
						UPDATE vin_metrics SET [1stQ] = @iMeter WHERE VIN = @sVIN AND [Year] = @iYear AND ([1stQ] < @iMeter OR [1stQ] IS NULL);
						UPDATE vin_metrics SET [1stQMin] = @iMeter WHERE VIN = @sVIN AND [Year] = @iYear AND ([1stQMin] > @iMeter OR [1stQMin] IS NULL);
					END
				ELSE IF @iMonth <= 6
					BEGIN
						UPDATE vin_metrics SET [2ndQ] = @iMeter WHERE VIN = @sVIN AND [Year] = @iYear AND ([2ndQ] < @iMeter OR [2ndQ] IS NULL);
						UPDATE vin_metrics SET [2ndQMin] = @iMeter WHERE VIN = @sVIN AND [Year] = @iYear AND ([2ndQMin] > @iMeter OR [2ndQMin] IS NULL);
					END
				ELSE IF @iMonth <= 9
					BEGIN
						UPDATE vin_metrics SET [3rdQ] = @iMeter WHERE VIN = @sVIN AND [Year] = @iYear AND ([3rdQ] < @iMeter OR [3rdQ] IS NULL);
						UPDATE vin_metrics SET [3rdQMin] = @iMeter WHERE VIN = @sVIN AND [Year] = @iYear AND ([3rdQMin] > @iMeter OR [3rdQMin] IS NULL);
					END
				ELSE IF @iMonth <= 12
					BEGIN
						UPDATE vin_metrics SET [4thQ] = @iMeter WHERE VIN = @sVIN AND [Year] = @iYear AND ([4thQ] < @iMeter OR [4thQ] IS NULL);
						UPDATE vin_metrics SET [4thQMin] = @iMeter WHERE VIN = @sVIN AND [Year] = @iYear AND ([4thQMin] > @iMeter OR [4thQMin] IS NULL);
					END
			END
		ELSE
			BEGIN
				IF @iMonth <= 3
					BEGIN
						INSERT INTO vin_metrics (VIN,VehType,[Year],[1stQ],[1stQMin]) VALUES (@sVIN,@sVehType,@iYear,@iMeter,@iMeter)
					END
				ELSE IF @iMonth <= 6
					BEGIN
						INSERT INTO vin_metrics (VIN,VehType,[Year],[2ndQ],[2ndQMin]) VALUES (@sVIN,@sVehType,@iYear,@iMeter,@iMeter)
					END
				ELSE IF @iMonth <= 9
					BEGIN
						INSERT INTO vin_metrics (VIN,VehType,[Year],[3rdQ],[3rdQMin]) VALUES (@sVIN,@sVehType,@iYear,@iMeter,@iMeter)
					END
				ELSE IF @iMonth <= 12
					BEGIN
						INSERT INTO vin_metrics (VIN,VehType,[Year],[4thQ],[4thQMin]) VALUES (@sVIN,@sVehType,@iYear,@iMeter,@iMeter)
					END
			END

		FETCH NEXT FROM cur INTO @sVIN,@sVehType,@iMeter,@iYear,@iMonth
END
CLOSE cur;
DEALLOCATE cur;
END







