CREATE PROCEDURE [dbo].[usp_WOFF_CloseUtil]
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

	DECLARE @TransactNo VARCHAR(150)
	DECLARE @UtilDate DATE
	DECLARE @ReturnDate DATE
	DECLARE @ReportDate DATE

	DECLARE cur CURSOR FOR  select  rf.TransactNo,rf.UtilDate,rf.ReturnDate,wf.ReportDate
						From req_utilize_form rf inner join wor_vehicle_info wf on rf.vin = wf.vin 
						where rf.UtilStatus in ('On-going' ,'On Lease')

