-- ----------------------------
-- Procedure structure for Util_Per_Qtr
-- ----------------------------
DROP PROCEDURE [dbo].[Util_Per_Qtr]
GO




CREATE PROCEDURE [dbo].[Util_Per_Qtr]
	@Qtr AS int,
	@Yr AS VARCHAR(4)
AS
BEGIN
  SELECT f.NLID, v.VIN, v.VehType, f.TPEno, f.MeterType, f.[Year], f.Make, f.Model, vr.UnitOrgSec,
		v.MinQ,v.MaxQ,CONVERT(bigint,(v.MaxQ - v.MinQ)) as SQEM,
		CAST(ROUND((Total / 4), 2) AS NUMERIC(36, 2)) AQU, CAST(ROUND((( SUM(Total) OVER(PARTITION BY v.VehType) / COUNT(v.VIN) OVER(PARTITION BY v.VehType)) / 4), 2) AS NUMERIC(36, 2)) QUTP
	FROM
	(
		SELECT a.VIN, a.VehType, MAX(MinQ) MinQ, MAX(MaxQ) MaxQ, SUM(Total) Total
		FROM 
		(
			SELECT v.VIN, 
				v.VehType, 
				CASE @Qtr
					WHEN '3' THEN v.[1stQMin]
					WHEN '6' THEN v.[2ndQMin]
					WHEN '9' THEN v.[3rdQMin]
									 ELSE v.[4thQMin]
				END MinQ, 
				0 MaxQ, 
				CASE WHEN v.[1stQ] - v.[1stQMin] < 0 THEN 0 ELSE v.[1stQ] - v.[1stQMin] END + 
				CASE WHEN v.[2ndQ] - v.[2ndQMin] < 0 THEN 0 ELSE v.[2ndQ] - v.[2ndQMin] END + 
				CASE WHEN v.[3rdQ] - v.[3rdQMin] < 0 THEN 0 ELSE v.[3rdQ] - v.[3rdQMin] END + 
				CASE WHEN v.[4thQ] - v.[4thQMin] < 0 THEN 0 ELSE v.[4thQ] - v.[4thQMin] END Total
			FROM vin_metrics v 
			WHERE	v.[Year] = @Yr
				
			UNION ALL
			
			SELECT v.VIN,
				v.VehType, 
				0 MinQ, 
				CASE @Qtr
					WHEN '3' THEN v.[1stQ]
					WHEN '6' THEN v.[2ndQ]
					WHEN '9' THEN v.[3rdQ]
									 ELSE v.[4thQ]
				END MaxQ, 
				0 Total
			FROM vin_metrics v 
			WHERE	v.[Year] = @Yr
		) a
		GROUP BY a.VIN, a.VehType
	) v
	INNER JOIN fleet f ON v.vin = f.vin 
	INNER JOIN vehicle_registration vr ON f.VIN = vr.VIN
		INNER JOIN
		(
			SELECT VIN, MAX(RegId) maxReg
			FROM vehicle_registration
			GROUP BY VIN
		) c ON f.VIN = c.VIN AND vr.RegID = c.maxReg
	WHERE	f.MeterType in ('Mile','Kilometers') AND v.MaxQ - v.MinQ > 0
	ORDER by VehType
END







