-- ----------------------------
-- Procedure structure for Util_Target
-- ----------------------------
DROP PROCEDURE [dbo].[Util_Target]
GO




CREATE PROCEDURE [dbo].[Util_Target]
	@Yr AS VARCHAR(4)
AS
BEGIN
  SELECT f.NLID, v.VIN, v.VehType, f.TPEno, f.MeterType, f.[Year], f.Make, f.Model, vr.UnitOrgSec, CAST(ROUND(Total, 2) AS NUMERIC(36, 2)) AEM, 
		CAST(ROUND(((SUM(Total) OVER(PARTITION BY v.VehType)/COUNT(v.VIN) OVER(PARTITION BY v.VehType)) * 0.5), 2) AS NUMERIC(36, 2)) UTP
	FROM
	(
		SELECT a.VIN, a.VehType, SUM(Total) Total
		FROM 
		(
			SELECT v.VIN, v.VehType, 
				(CASE WHEN v.[1stQ] - v.[1stQMin] < 0 THEN 0 ELSE v.[1stQ] - v.[1stQMin] END) + 
				(CASE WHEN v.[2ndQ] - v.[2ndQMin] < 0 THEN 0 ELSE v.[2ndQ] - v.[2ndQMin] END) + 
				(CASE WHEN v.[3rdQ] - v.[3rdQMin] < 0 THEN 0 ELSE v.[3rdQ] - v.[3rdQMin] END) + 
				(CASE WHEN v.[4thQ] - v.[4thQMin] < 0 THEN 0 ELSE v.[4thQ] - v.[4thQMin] END) Total
			FROM vin_metrics v 
			WHERE	v.[Year] = @Yr
		) a
		GROUP BY a.VIN, a.VehType
	) v
	INNER JOIN fleet f ON v.vin = f.vin 
	INNER JOIN vehicle_registration vr ON f.VIN = vr.VIN
	INNER JOIN
	(
		SELECT VIN, MAX(RegId) maxReg
		FROM vehicle_registration
		GROUP BY VIN
	) c ON f.VIN = c.VIN AND vr.RegID = c.maxReg
	WHERE	f.MeterType in ('Mile','Kilometers')
	ORDER by VehType;
END







