-- ----------------------------
-- Procedure structure for Yearly_Util
-- ----------------------------
DROP PROCEDURE [dbo].[Yearly_Util]
GO






CREATE PROCEDURE [dbo].[Yearly_Util]
	@year1 VARCHAR(100) = null,
	@year2 VARCHAR(100) = null
AS
BEGIN
DECLARE @Month INT
DECLARE @year INT

DECLARE @DBs TABLE
(
        ID int IDENTITY PRIMARY KEY,
        Months Int,
				Years INT,
				Days DATE,
		    PeakDemand BIGINT,
				AveDemand FLOAT
)

SET @year = @year1
WHILE(@year <= @year2)
BEGIN
	set @Month = 1
	WHILE (@Month <= 12)
	BEGIN
		DECLARE @result INT
		DECLARE @SiteCount INT 
		
		SELECT @SiteCount = COUNT(DISTINCT SiteCode) FROM fleet

		;WITH mycte AS
		(
			SELECT CAST(CAST(@year AS VARCHAR) + '-' + CAST(@Month AS VARCHAR) + '-01' AS DATETIME)  DateValue
			UNION ALL
			SELECT  DateValue + 1
			FROM    mycte   
			WHERE   DateValue + 1 < DATEADD(mm,1,CAST(CAST(@year AS VARCHAR) + '-' + CAST(@Month AS VARCHAR) + '-01' AS date))
		)

	INSERT INTO @DBs (Months,Years, Days, PeakDemand,AveDemand)
	select TOP 1 @Month, 
				 @year, 
				 DATEADD(s,-1,DATEADD(mm, DATEDIFF(m,0,DateValue)+1,0)), 
				 sum(a.cnt), SUM(a.cnt) / @SiteCount
	from 
	(
	SELECT COUNT(DISTINCT VIN) cnt, c.DateValue
		FROM mycte c 
		CROSS JOIN wp_lease_vehicle wl
		WHERE (wl.Status = 'Closed' AND CAST(c.DateValue AS Date) BETWEEN wl.StartDate AND wl.EndDate) OR 
				  (wl.Status = 'Open' AND wl.StartDate <= CAST(c.DateValue AS Date))
		GROUP BY c.DateValue
	) a
	group by a.DateValue ORDER BY sum(a.cnt) DESC

		SET @Month = @Month + 1
	END
SET @year = @year + 1
END

SELECT Days,
			 PeakDemand,
			 AveDemand,
			 (SELECT COUNT(VIN) 
				FROM fleet 
				WHERE RegistrationDate <= Days AND SUBSTRING(SiteCode, 1, 1) = 'F' 
				AND RegistrationDate IS NOT NULL AND Status <> 'Written-Off' AND (IsArchive = 0 OR IsArchive IS NULL) AND Active =1
				) Capacity
FROM @DBs
END








