-- Function structure for GetCusFeedByQuestion
-- ----------------------------
DROP FUNCTION [dbo].[GetCusFeedByQuestion]
GO




CREATE FUNCTION [dbo].[GetCusFeedByQuestion]
(
	@year int,
	@sites varchar(max),
	@WeekNo int,
	@col varchar(50)
)
RETURNS DECIMAL(9,2)
AS
BEGIN
	DECLARE @CusRes DECIMAL(9, 2)
	
	SELECT @CusRes = CAST(ROUND(((ques/rws) * 100), 2, 1) AS DECIMAL(9,2)) 
	FROM
		(SELECT 
			CASE @col
			     WHEN 'EaseVehReq' THEN SUM(EaseVehReq)
				 WHEN 'StaffCourtesyDes' THEN SUM(StaffCourtesyDes)
				 WHEN 'VehPerformance' THEN SUM(VehPerformance)
				 WHEN 'VehCleanliness' THEN SUM(VehCleanliness)
				 WHEN 'VehicleReturn' THEN SUM(VehicleReturn)
				 WHEN 'StaffCourtesyRet' THEN SUM(StaffCourtesyRet)
				 WHEN 'StafPerfAll' THEN SUM(StafPerfAll)
				 WHEN 'VehicleSelect' THEN SUM(VehicleSelect)
			END ques, 
			 COUNT(*) rws
		FROM customer_ss
		WHERE Year([Date])= @year AND ( @sites = 'ALL' OR SiteCode = @sites ) AND WeekNo = @WeekNo
		GROUP BY WeekNo) tbl	

	RETURN @CusRes

END








