CREATE FUNCTION [dbo].[GetCusSatisfaction]
(
	@year int,
	@sites varchar(max),
	@WeekNo int
)
RETURNS DECIMAL(9, 2)
AS
BEGIN
	DECLARE @CusRes DECIMAL(9, 2)
	
	SELECT @CusRes = CAST(ROUND(((Total/rws) * 100)/8, 2, 1) AS DECIMAL(9,2)) 
	FROM
			(SELECT 
				 WeekNo, 
				 SUM(EaseVehReq) + SUM(StaffCourtesyDes) + SUM(VehPerformance) + SUM(VehCleanliness) + SUM(VehicleReturn) + SUM(StaffCourtesyRet) + SUM(StafPerfAll) + SUM(VehicleSelect) Total,
				 COUNT(*) rws
			FROM customer_ss
			WHERE Year([Date])= @year AND ( @sites = 'ALL' OR SiteCode = @sites ) AND WeekNo = @WeekNo
			GROUP BY WeekNo) tbl

	RETURN @CusRes
END








GO

