-- ----------------------------
-- Triggers structure for table fleet
-- ----------------------------
DROP TRIGGER [dbo].[trig_fleet]
GO
CREATE TRIGGER [dbo].[trig_fleet]
ON [dbo].[fleet]
AFTER INSERT, UPDATE
AS

BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;
	
	UPDATE	f SET 
			f.NextServiceDate = CASE WHEN i.[Status] = 'Completed Repair' THEN DATEADD(DAY,45,i.LastService) ELSE NULL END,
			f.ReleasedYN = CASE i.Released WHEN 1 THEN 'Yes' ELSE 'No' END,
			f.MileConversionValue = CASE	WHEN  i.MeterType = 'Kilometers' THEN
			CONVERT(varchar,CAST(CONVERT(DECIMAL(16,4),i.Mileage)*0.621371 as Decimal(10,4)))
			WHEN i.MeterType = 'Mile' THEN
			CONVERT(varchar,i.Mileage)
			ELSE 'N/A' END,
			f.RepairCount = (select COUNT(WONo) from workorder where nlid = i.nlid and [Status] = 'Closed'),
			f.[Status] = CASE	WHEN  i.[Status] = 'Completed Repair' and (i.TempClose = 1) THEN 'Released Awaiting for Parts' 
								WHEN  i.[Status] = 'Released Awaiting for Parts' and (i.TempClose = 0 or i.TempClose is null) THEN 'Completed Repair'
								ELSE i.[Status] 
						 END
	FROM	inserted as i JOIN
			fleet as f	on f.NLID = i.NLID
END





